'use strict';
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class DXFeedSubscribeForTimeSeriesRequest {
    symbol;
    timeframe;
    from;
    constructor() {
        this.symbol = null;
        this.timeframe = null;
        this.from = stdlib.mkdate(1900, 1, 1);
    }
    static create(symbol, timeframe, from) {
        let result;
        result = new DXFeedSubscribeForTimeSeriesRequest();
        result.symbol = symbol;
        result.timeframe = timeframe;
        result.from = from;
        return result;
    }
    getSymbol() {
        return this.symbol;
    }
    getTimeframe() {
        return this.timeframe;
    }
    getFrom() {
        return this.from;
    }
}
module.exports = DXFeedSubscribeForTimeSeriesRequest
